-- =============================================
-- CRACIÓN DE LA APLICACIÓN
-- =============================================

DECLARE
	N INT;
	COMMAND VARCHAR2(200);
BEGIN
	COMMAND := 'DROP USER db_orders CASCADE';
	SELECT COUNT(*) INTO N
	FROM DBA_USERS
	WHERE USERNAME = upper('db_orders');
	IF ( N = 1 ) THEN
		EXECUTE IMMEDIATE COMMAND;
	END IF;
END;
/

CREATE USER db_orders IDENTIFIED BY 123456;

GRANT CONNECT, RESOURCE TO db_orders;


-- =============================================
-- CONECTARSE A LA APLICACIÓN
-- =============================================

CONNECT db_orders/123456




