-----------------------------------------------------
---------SECUENCIA CATEGORIAS
-----------------------------------------------------

CREATE SEQUENCE CATEGORIAS_seq START WITH 9;
/
CREATE OR REPLACE TRIGGER CATEGORIAS_seq_id 
BEFORE INSERT ON CATEGORIAS 
FOR EACH ROW
WHEN (new.IDCATEGORIA is null)
BEGIN
  SELECT CATEGORIAS_seq.NEXTVAL
  INTO   :new.IDCATEGORIA
  FROM   dual;
END;
/

